(()=>{var c="WebPixel::Render";var s=e=>shopify.extend(c,e);s(({analytics:e})=>{e.subscribe("checkout_completed",o=>{let n=o.data.checkout,i=n.totalPrice.amount,r=n.discountApplications.map(t=>{if(t.type==="DISCOUNT_CODE")return t.title}),a=n.lineItems[0],m=a.discountAllocations[0].amount,u={quantity:a.quantity,title:a.title,discount:m},l=o.data.checkout.transactions.map(t=>({paymentGateway:t.gateway,amount:t.amount})),p={event_name:o.name,event_data:{totalPrice:i,discountCodesUsed:r,firstItem:u,paymentTransactions:l}};console.log(p)})});})();
